import React from 'react';
import Loader from '../../../components/Loader';

class AuthPage {
    render() {
        const { loading } = this.props;
        if (loading) return <Loader />
        // if (localStorage.getItem("UserAdmin")) return <Redirect to="/dashboard" />
        return (
            <div className="container">
                <div className="row">
                    <div className="col-md-6 mx-auto">
                        <h3>AuthPage</h3>
                        <form onSubmit={this.handleLogin}>
                            {this.renderNoti()}
                            <div className="form-group">
                                <label>Username</label>
                                <input type="text" className="form-control" name="taiKhoan" onChange={this.handleOnChange} />
                            </div>
                            <div className="form-group">
                                <label>Password</label>
                                <input type="text" className="form-control" name="matKhau" onChange={this.handleOnChange} />
                            </div>
                            <button type="submit" className="btn btn-success">
                                Login
                            </button>
                        </form>
                    </div>
                </div>
            </div>
        )
    }
}

export default AuthPage;
